import { ShirtColor } from 'graphql-global-types';

export const AddShirt: React.FunctionComponent = () => {
  return (
    <div>
      <form>
        <div>
          <label>
            <input name="name" />
          </label>
          <label>
            <select name="color" required>
              {Object.values(ShirtColor).map((color) => (
                <option key={color} value={color}>
                  color
                </option>
              ))}
            </select>
          </label>
          <label>
            <input name="size" min="1" type="number" />
          </label>
        </div>
        <div>
          <button>Add</button>
          <button>Cancel</button>
        </div>
      </form>
    </div>
  );
};
